pragma solidity >=0.6.0 <0.8.0;

import "./PrivateCompany.sol";

// mock class using PrivateCompany
contract PrivateCompanyMock is PrivateCompany {
    constructor(string memory _companyName, string memory _token)
        public
        PrivateCompany(_companyName, _token)
    {}

    function vestedEquityAmount(address holderAddress) external view {
        _vestedEquityAmount(holderAddress);
    }
}
